import { motion } from 'framer-motion';

function App() {
  const data = [
    { 
      label: "50:50",
      values: [
        { type: "creator", percent: 50, color: "bg-green-500" },
        { type: "platform", percent: 50, color: "bg-blue-500" }
      ]
    },
    { 
      label: "70:30",
      values: [
        { type: "creator", percent: 70, color: "bg-green-500" },
        { type: "platform", percent: 30, color: "bg-blue-500" }
      ]
    },
    { 
      label: "90:10",
      values: [
        { type: "creator", percent: 90, color: "bg-green-500" },
        { type: "platform", percent: 10, color: "bg-blue-500" }
      ]
    }
  ];

  return (
    <div className="max-w-5xl mx-auto p-8">
      <header className="text-center mb-16">
        <div className="inline-block relative mb-6">
          <img 
            src="https://em-content.zobj.net/source/microsoft-teams/337/bullseye_1f3af.png" 
            alt="target" 
            className="w-16 h-16 absolute -left-20 -top-2"
          />
          <h1 className="text-5xl font-bold">Revenue Split Models</h1>
        </div>
        <p className="text-xl text-gray-600">How Platforms & Creators Share the Pie</p>
      </header>

      <div className="space-y-8 mb-16">
        {[
          { title: "50:50 Model", desc: "Equal share, Best for early-stage platforms." },
          { title: "70:30 Model", desc: "Most common in app stores & platforms." },
          { title: "90:10 Model", desc: "Creator-friendly model for big creators." }
        ].map((model, i) => (
          <div key={i} className="bg-white rounded-lg p-8 shadow-sm hover:shadow-md transition-shadow">
            <h2 className="text-3xl font-bold mb-4">{model.title}</h2>
            <p className="text-gray-600 text-lg mb-6">{model.desc}</p>
            <button className="px-6 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-600 transition-colors">
              View Details
            </button>
          </div>
        ))}
      </div>

      <div className="bg-white rounded-lg p-8 shadow-sm">
        <div className="flex items-center gap-3 mb-12">
          <span role="img" aria-label="money bag" className="text-3xl">💰</span>
          <h2 className="text-3xl font-bold">Revenue Distribution Overview</h2>
        </div>

        <div className="relative mx-12">
          <div className="flex">
            <div className="flex flex-col justify-between h-[360px] pr-4">
              {Array.from({ length: 11 }).map((_, i) => (
                <div key={i} className="flex items-center justify-end h-0">
                  <span className="text-sm text-gray-500 mr-2">
                    {(10 - i) * 10}
                  </span>
                  <div className="w-[calc(100vw-200px)] border-t border-gray-200 relative -left-4"
                       style={{opacity: i === 10 ? '1' : '0.2'}} />
                </div>
              ))}
            </div>

            <div className="flex justify-around w-full">
              {data.map((model, i) => (
                <div key={i} className="flex flex-col items-center w-32">
                  <div className="relative w-full h-[360px]">
                    <motion.div 
                      className={`absolute bottom-0 w-full ${model.values[1].color}`}
                      initial={{ height: 0 }}
                      animate={{ height: `${model.values[1].percent}%` }}
                      transition={{ duration: 1 }}
                    />
                    <motion.div 
                      className={`absolute w-full ${model.values[0].color}`}
                      initial={{ height: 0 }}
                      animate={{ height: `${model.values[0].percent}%` }}
                      transition={{ duration: 1 }}
                      style={{ bottom: `${model.values[1].percent}%` }}
                    />
                  </div>
                  <p className="mt-4 font-medium">{model.label}</p>
                </div>
              ))}
            </div>
          </div>
        </div>

        <div className="flex justify-center gap-8 mt-12">
          <div className="flex items-center gap-2">
            <div className="w-4 h-4 bg-green-500 rounded"></div>
            <span>Creator</span>
          </div>
          <div className="flex items-center gap-2">
            <div className="w-4 h-4 bg-blue-500 rounded"></div>
            <span>Platform</span>
          </div>
        </div>
      </div>

      <motion.footer 
        className="mt-16 text-center text-gray-500"
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6 }}
      >
        © 2025 RevenueSplit. All rights reserved.
      </motion.footer>
    </div>
  );
}

export default App;
